import React from "react"

function Home(props) {
   console.log(props.data,'6666666666');
   const ListData = props.data.map(function(x,index){
    return(
      <div>
        <div key={x.id} className={'name'+index}>{x.name}</div>
        <div>{x.old}</div>
      </div>
    )
   });

  return(
  <div className="content">
    <h1>Gợi Ý Hôm Nay </h1>
     {ListData}
  </div>
)
}

export default Home;
